func nameClarifier(_ file: File, in parent: Folder) -> [FSFile] {
	if let newName = lookupTable[file.name] {
		return [.file(file.renamed(to: newName))]
	}
	return [.file(file)]
}

func nameObfuscator(_ file: File, in parent: Folder) -> [FSFile] {
	if let newName = reverseLookupTable[file.name] {
		return [.file(file.renamed(to: newName))]
	}
	return [.file(file)]
}

